int superFunctionalStrings(string s) {

  int l = s.length();

  std::vector<int> u;
  std::vector<int> v;
  std::vector<int> h;
  std::vector<std::vector<int>> rmq;
  std::vector<int> p;
  std::vector<int> w;
  std::vector<int> counts;
  std::vector<std::vector<int>> lasts(26,std::vector<int>(l+1,-1));
  for(int i=0; i<l; ++i){
      lasts[s[i]-'a'][i+1] = i;
      for(int j=0; j<s[i]-'a'; ++j){
        lasts[j][i+1] = lasts[j][i];
      }
      for(int j=s[i]-'a'+1; j<26; ++j){
        lasts[j][i+1] = lasts[j][i];
      }
  }

  preprocess(s,u,v,h,counts,lasts,rmq,w,p);

  const int modulo = 1000000007;
  long int sum(0);
  int n = h.size();
  int lcp(0);
  uint count(0);
  std::array<int,26> indx;
  indx.fill(0);
  for(int i=0; i<l; ++i){
    if(indx[s[i]-'a']++==0){
      ++count;
    }
  }
  uint mxcount = count+1;

  count = 0;
  indx.fill(0);

  std::vector<std::vector<int>> memo(mxcount,std::vector<int>(l+1,0));
  for(int i=0; i<l+1; ++i){
    memo[1][i] = i;
  }
  for(uint j=2; j<mxcount; ++j){
    for(int i=0; i<l+1; ++i){
      memo[j][i] = (static_cast<long int>(memo[j-1][i])*memo[1][i])%modulo;
    }
  }
  sum = 0;
  for(uint j=1; j<mxcount; ++j){
    for(int i=1; i<l+1; ++i){
      memo[j][i] = (static_cast<long int>(memo[j][i-1])+memo[j][i])%modulo;
    }
  }
  sum = 0;

  for(int i=n-1; i>=0; --i){
    int k = p[i+1];
    int l1(lcp);
    for(int j=k+lcp; j<l; ++j){
      if(lasts[s[j]-'a'][j]<k){
        sum = ((sum -memo[count][l1] + memo[count][j-k])%modulo + modulo)%modulo;
        l1 = j-k;
        ++count;
      }
    }
    sum = ((sum -memo[count][l1] +memo[count][l-k])%modulo + modulo)%modulo;
    lcp = h[i];
    count = counts[i];

  }

  return sum;

}

void preprocess(string& s,
                  std::vector<int>&u,
                  std::vector<int>& v,
                  std::vector<int>& h,
                  std::vector<int>& counts,
                  std::vector<std::vector<int>>& lasts,
                  std::vector<std::vector<int>>& rmq,
                  std::vector<int>& w,
                  std::vector<int>& p){

  for(uint i=0; i<s.length(); ++i){
    u.push_back(s[i]-'a');
  }
  v = std::vector<int>(u.size(),0);
  h = std::vector<int>(u.size(),0);
  counts = std::vector<int>(u.size(),0);

  dc3(u,v);
  lcp(s,v,h,counts,lasts);

  p = std::vector<int>(u.size(),0);
  for(uint i=0; i<u.size(); ++i){
    p[v[i]] = i;
  }

}

void lcp(string& s, std::vector<int>& v, std::vector<int>& h, std::vector<int>& counts,std::vector<std::vector<int>>& lasts){
  int n = v.size();
  std::vector<int> pos(n,0);
  for(int i=0; i<n; ++i){
    pos[v[i]] = i;
  }

  int k(0);
  for(int i=0; i<n-1; ++i){ // At most 2n char comparisons.
    int j = pos[v[i]-1];
    while(i+k<n-1 && s[i+k]==s[j+k]){
      if(lasts[s[i+k]-'a'][i+k]<i){
        ++counts[v[i]-1];
      }
      ++k;
    }
    h[v[i]-1] = k;

    if(k>0){

        counts[v[i+1]-1] = counts[v[i]-1];
        if(i<n-2 && lasts[s[i]-'a'][i+k]==i){
          --counts[v[i+1]-1];
        }

      --k;
    }
  }
}

void dc3(std::vector<int>& u, std::vector<int>& v){

  int n = u.size();
  u.push_back(-1);

  if(n<=2){
        std::iota(v.begin(),v.end(),1);
        v.push_back(0);
        if(n==2 && u[1]<=u[0]){
            std::swap(v[0],v[1]);
        }
    return;
  }

  v.push_back(0);
  ++n;

  int n1((n-1+2)/3);
  int n2((n-2+2)/3);

  // build u[1...]+u[2...].
  std::vector<std::array<int,4>> w(n1+n2,std::array<int,4>());
  u.push_back(-1);
  u.push_back(-1);
  int mxm(u[0]);
  for(int i=0; i<n1; i++){
    w[i][0] = u[3*i+1];
    w[i][1] = u[3*i+2];
    w[i][2] = u[3*i+3];
    w[i][3] = i;
    mxm = std::max(mxm,std::max(u[3*i+1],std::max(u[3*i+2],u[3*i+3])));

  }
  for(int i=0; i<n2; i++){
    w[i+n1][0] = u[3*i+2];
    w[i+n1][1] = u[3*i+3];
    w[i+n1][2] = u[3*i+4];
    w[i+n1][3] = i+n1;
  }

  // radix sort blocks of 3. O(n+|Σ|).
  u.pop_back();
  u.pop_back();
  std::vector<std::array<int,4>> w1(n1+n2,std::array<int,4>());
  for(int k=0; k<3; ++k){
      std::vector<int> c((uint)mxm+2,0);

      for(int i=0; i<n1+n2; ++i){
        c[w[i][2-k]+1]++;
      }
      for(uint i=1; i<(uint)mxm+2; ++i){
        c[i] += c[i-1];
      }
      for(int i=n1+n2-1; i>=0; --i){
        w1[--c[w[i][2-k]+1]] = w[i];
      }
      std::swap(w1,w);

  }

  std::vector<int> u1(n1+n2,0);
  int count(0);

  for(int i=0; i<n1+n2; ++i){
    if(i>0 && (w[i][0]!=w[i-1][0] || w[i][1]!=w[i-1][1] || w[i][2]!=w[i-1][2] )){
      ++count;
    }
    u1[w[i][3]] = count;
  }

  // recursively compute suffix array for array of size 2n/3.
  std::vector<int> v2(n1+n2,0);
  dc3(u1,v2);

  // radix sort element at indices multiples of 3. O(n+|Σ|).
    std::vector<std::array<int,3>> u2(n-n1-n2,std::array<int,3>());
    for(int i=0; i<n-n1-n2; ++i){
        u2[i] = {{u[3*i],3*i+1<n?v2[i]:-1,3*i}};
    }
    std::vector<std::array<int,3>> u3(n-n1-n2,std::array<int,3>());
  mxm  = std::max(mxm,n1+n2);          //  |Σ| = size of current alphabet. (mxm ⩽ n && n1+n2 ⫹ 2n/3) ⇒ |Σ|⩽ n.

    for(int k=0; k<2; ++k){
        std::vector<int> c((uint)mxm+2,0);

        for(int i=0; i<n-n1-n2; ++i){
            c[u2[i][1-k]+1]++;
        }
        for(uint i=1; i<(uint)mxm+2; ++i){
            c[i] += c[i-1];
        }
        for(int i=n-n1-n2-1; i>=0; --i){
            u3[--c[u2[i][1-k]+1]] = u2[i];
        }
        std::swap(u2,u3);

    }

  // merge. O(n).
    int i1(0), i12(0);
  std::vector<int> v1(n1+n2,0);
  for(int i=0; i<n1; ++i){
    v1[v2[i]-1] = 3*(i) + 1;
  }
  for(int i=0; i<n2; ++i){
    v1[v2[n1+i]-1] = 3*(i) + 2;
  }

    for(int i=0; i<n; ++i){

    if(i1==n-n1-n2){
       v[v1[i12++]] = i;
    }
    else if(i12==n1+n2 || u[u2[i1][2]]<u[v1[i12]] ||
        (u[u2[i1][2]] == u[v1[i12]] && v1[i12]%3==1 && (u2[i1][2]+1==n || (v1[i12]+1<n && v2[u2[i1][2]/3] < v2[n1+v1[i12]/3])) ) ||
         (u[u2[i1][2]] == u[v1[i12]] && v1[i12]%3==2 && (u[u2[i1][2]+1] < u[v1[i12]+1]||  (u[u2[i1][2]+1] == u[v1[i12]+1] && (u2[i1][2]+2 == n || (v1[i12]+2<n && v2[u2[i1][2]/3+n1]<v2[v1[i12]/3+1])))) ) ){

        v[u2[i1++][2]] = i;
    }
    else{
        v[v1[i12++]] = i;
    }
    }

}
